import React from 'react';
import Navigation from "../components/Navigation";
import Card from "../components/Card";

const movies_p = () => {
    return (
        <div>
            <Navigation />
            <h1>Movies</h1>
            <div className="container">
                <Card />
            </div>
        </div>
    );
};

export default movies_p;
